(27756, 60015, 0, 3, '02.End Up The World', '歌詞內容:\r\n愚蠢的人類總是被害妄想自以為將有外太空來的高等文明要毀滅地球，但人類的破壞力遠過於宇宙上任何高等生物，我們一點一滴的殘殺著我們的大地之母，End Up The World就是我們每分每秒再做的事。\r\n這首歌是以反諷為出發的勸世歌曲。\r\n編曲方向:\r\n以新金屬編曲編排為骨、放克節奏為肉、前衛元素為血、哈扣為皮，合成的一首歌。以放克Riff帶動節拍再引爆出更強悍的Riff，中段用7/8拍為變奏，最後在一次新金屬配上哈扣式的大爆炸。', '2010-06-05 00:00:00', 2000, 20, 0, 9, '窗外的溫度34度，我們卻在24度的冷氣房簽下京都訂書\r\n手上的飲料14度卻換來氟氯碳化物，它就是無色無味無聲無息的致命因素\r\n我們都知道這樣不好，節能減炭天經地道，但科技進步讓我們都放棄不了\r\n方便的生活要繼續爽只好假裝看不到、聽不到攜手把地球毀滅掉\r\n\r\nMother Fucker\r\n你們什麼都不會，只會看電視\r\nMother Fucker \r\n你們什麼都不會，只會喝醉酒\r\nMother Fucker \r\n你們什麼都不會，只會追潮流\r\nMother Fucker \r\n你們什麼都不會，只會選總統\r\n或許不用等到，2012來到，我們就能看到，天國提早來到\r\n我們總是睜一隻眼閉一隻眼假裝看不到、聽不到把地球毀滅掉\r\n\r\nEnd up the fuckin world .(譯:終結他媽的世界)\r\nEnd up the fuckin world .\r\nEnd up the fuckin world .\r\nEnd up the world .\r\n\r\nThe world will end by our hand .(譯:世界將終結在我們手上)\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\n\r\nAfsa Afsa Maliun Gisu  (阿美族語:膩了，膩了，你們講都講不聽)\r\nAfsa Afsa Maliun Gisu\r\nAfsa Afsa Maliun Gisu\r\nAfsa Afsa \r\n\r\nYou want to stay alive , you better realize.\r\nYou can run can hide or stand up and fight .\r\nThe game is on you better choose your style \r\nat live that determinant your dead style .\r\n(譯:你想活著，你最好清楚的了解\r\n你可以逃走、可以躲避、或者站起來戰鬥\r\n遊戲已經開始了你最好選擇你該怎麼活\r\n因為你怎麼活就決定你將怎麼死)\r\n\r\nThe world will end by our hand .(譯:世界將終結在我們手上)\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\nThe world will end by our hand .', '', 190, '', 'Percussion Cap', '張逸塵', 'Percussion Cap', '', '', 0, 0, 1, '2010-09-15 11:15:24', '2013-10-07 17:17:00', '0000-00-00 00:00:00'),
