(27772, 81092, 0, 1, '放手做(Demo)', '相信大家心裡都有個夢想 \r\n也許那個夢想可能遙不可及\r\n但是要是現在不努力去做,那一定不會成功\r\n希望未來以後的我們大家要喜歡現在的自己\r\n也記得從前一起的快樂時光\r\n以及相聚在一起的那份初衷\r\n\r\n這首放手做 送給大家 希望有夢想不要放棄\r\n\r\n放手去做', '2010-09-15 00:00:00', 2000, 0, 2, 4, '放手做\r\n詞:七號公車-阿給\r\n曲:七號公車-威廉\r\n\r\n(前奏)\r\n曾經夢想過 征服這宇宙\r\n一天天大了 才發覺這是夢\r\n因為有你陪伴 因為有你取暖\r\n喔~不遺憾\r\n\r\nA1\r\n那年的手中 純真的笑容\r\n盛開的花瓣 時間不停的走\r\n最美的時候 也曾經嘗過苦頭\r\n我們一起走\r\n\r\n正當微風 吹向我的心中\r\n那應該就是 遠方那道彩虹\r\n不管以前以後 不管現實難過\r\n只要一次 放肆的跳動\r\n\r\n＊\r\n放手 勇敢的去做\r\n張開翅膀只是第一步驟\r\n以後 不管有甚麼\r\n不到最後誰也說不透\r\n\r\n＃\r\n大聲唱過 轟轟烈烈走過\r\n過了這年紀 還能夠走多久\r\n如果現在不做 現在退縮\r\n到時候痛哭流涕 後悔蹉跎\r\n喔 用力感受 在我們渺小心中\r\n都有愛做夢的理由\r\n如果放棄跳動 放棄轉動\r\n請你溫柔的告訴我 放手去做\r\n\r\nA2\r\n遇見了你 是我最大的感動\r\n那應該就是 無盡頭的河流\r\n不管笑過哭過 只要有你有我\r\n然後一起 貪心的作夢\r\n\r\n重複 ＊ #\r\n', '', 275, '', '洪維聯-威廉', '王峻維-阿給', '七號公車', 'SEVEN BUS', '', 0, 0, 1, '2010-09-15 23:18:51', '2013-10-07 17:17:00', '0000-00-00 00:00:00'),
