(27803, 81492, 0, 1, 'Mon Chocolat Chaud', '巴黎旅行記憶與對熱巧克力的熱愛：）\r\n\r\n詞、曲、演唱    by Luet\r\n編曲、製作       b y 崔\r\n混音後製           by爵色音樂工作室', '2010-09-20 00:00:00', 2000, 0, 2, 3, 'Verse 1 \r\n I’m walking down the street busy Champs Elysees  我走在繁忙的香榭大道\r\nDreadful winter reindeers hop on a sleigh 　　　      寒冬裡麋鹿們跳上雪橇\r\nLois Vuitton, Armani, Chanel 　　　　　　　　　      走過L.V、阿曼尼、香奈兒\r\nThey don''t catch my eyes, they don''t ring a bell            今個都引不起我的興趣\r\n \r\nChristmas is around the corner                              耶誕節即將來臨\r\nSearching around excuse my manner                  恕我到處尋覓\r\nOoo..... .au Chocolat chaud,                                     嗯～一杯熱巧克力\r\nOoo..... au Chocolat chaud.                                      嗯～一杯熱巧克力\r\n\r\nVerse 2\r\nI’m strolling by the river Notre Dame de Paris   我漫步巴黎聖母院旁的河堤\r\nSnow in the air it smells so free                           雪花在空氣中氣味恣意\r\nCathedral organ’s playing jingle carols              大教堂裡傳出風琴演奏耶誕組曲\r\nMusic’s swirling penetrating fashion apparels  音樂繚繞穿梭在眩目的時尚服飾間\r\n\r\nSanta Claus he’s coming to town                             聖誕老人快進城來了\r\nLooking for this, how can I slow down                      我得加緊腳步尋覓\r\nCraving for mon chocolat chaud                              期待我的熱巧克力\r\nCraving for mon chocolat chaud                                 期待我的熱巧克力\r\n\r\nBridge\r\nStreet lights blinking, 　　　　　                 街燈閃爍\r\nWhat are you dreaming for　　                    你夢想著什麼？\r\nthis white Christmas                                      這個白色聖誕\r\nFire woods crashing,                                      壁爐裡木炭跳動\r\nWhat are you wishing                                      你的心願是什麼？\r\nwhen you’re warming up in red pajamas... 穿著暖和的紅色睡袍，\r\ncraving～ 　　　　　　　　　　　　           期待著～\r\n \r\nVerse 3 \r\nDancing in the circle splendent Moulin Rouge 舞者在閃耀的紅磨坊裡圍圈舞動\r\nLovers are kissing, hugging, drinking in the lounge愛侶們在酒館裡小酌親吻擁抱\r\nTuxedos, diamonds, perfume & high heels 西裝燕尾、美鑽、香水與高跟鞋\r\nI don’t give a look, they don’t ma